      shuffle_t = []\n        # print('start shuffle: ', flush=True)\n        for i in range(iterations):\n            client.cancel(df2)\n            start = time.time()\n            # shuffle(df, \"id\", shuffle=\"tasks\")\n            df2 = df.set_index(\"id\").persist()\n            wait(df2)\n            stop = time.time()\n            shuffle_t.append(stop - start)\n        shuffle_t = np.array(shuffle_t)\n\n    with performance_report(filename=f\"{today}-rand-access-scheduler.html\"):\n        rand_access = []\n        for i in range(iterations):\n            start = time.time()\n            df2.head()\n            stop = time.time()\n            rand_access.append(stop - start)\n        rand_access = np.array(rand_access)\n    return dict(simple=simple, shuffle=shuffle_t, rand_access=rand_access)\n\n        &lt;/pre&gt;\n        "},"id":"1210","type":"Div"},{"attributes":{"axis":{"id":"1118"},"ticker":null,"visible":false},"id":"1121","type":"Grid"},{"attributes":{"formatter":{"id":"1229"},"ticker":{"id":"1119"}},"id":"1118","type":"DatetimeAxis"},{"attributes":{},"id":"1092","type":"ResetTool"},{"attributes":{},"id":"1057","type":"ResetTool"},{"attributes":{},"id":"1005","type":"DataRange1d"},{"attributes":{"fill_alpha":{"field":"alpha"},"fill_color":{"field":"color"},"height":{"units":"data","value":0.4},"line_alpha":{"value":0.6},"line_color":{"field":"color"},"line_width":{"value":3},"width":{"field":"duration","units":"data"},"x":{"field":"start"},"y":{"field":"y"}},"id":"1128","type":"Rect"},{"attributes":{},"id":"1007","type":"LinearScale"},{"attributes":{"axis":{"id":"1081"},"ticker":null,"visible":false},"id":"1084","type":"Grid"},{"attributes":{"text":"Bandwidth by Worker"},"id":"1148","type":"Title"},{"attributes":{},"id":"1188","type":"CategoricalScale"},{"attributes":{},"id":"1012","type":"BasicTicker"},{"attributes":{"num_minor_ticks":5,"tickers":[{"id":"1253"},{"id":"1254"},{"id":"1255"},{"id":"1256"},{"id":"1257"},{"id":"1258"},{"id":"1259"},
